css:
#atom-console.view-resizer {
  overflow: hidden;
  cursor: default;
  -webkit-user-select: none;
}
#atom-console.view-resizer .view-resize-handle {
  position: absolute;
  top: 0;
  bottom: 0;
  height: 10px;
  width: 100%;
  cursor: row-resize;
  z-index: 3;
}
#atom-console .view-scroller {
  height: 100%;
  width: 100%;
  overflow: auto;
}
#atom-console .panel-body {
  height: 300px;
  background-color: #f4f2f7;
  cursor: text;
  -webkit-user-select: text;
}
#atom-console .panel-body.closed {
  height: 0px !important;
}
#atom-console .panel-body pre:empty {
  padding: 0;
}
#atom-console .panel-body p {
  margin: 0;
}
#atom-console .panel-body p.level-error {
  color: #f42a2a;
}
#atom-console .panel-body p.level-warn {
  color: #d5880b;
}
#atom-console .panel-body p.level-notice {
  color: #1492ff;
}
#atom-console .panel-body p.level-debug {
  color: #7c67a2;
}
